    <div className="grid">
        {docs && Object.keys(docs).map((doc,i) => (

            <Link to='document/:id' state={{docID:docs[doc]._id,docSummary:docs[doc].summary,id:docs[doc]._id}}
           /*to={`document/:${docs[doc]._id}`} 
           {{
                pathname:"document",
                state:"lol"
            }}*/ >
